import React from 'react';
import './App.css';

import Navbar from './components/NavBar.js';
import Homepage from './pages/homepage.js';
import AboutUs from './pages/aboutUs.js';
import Donations from './pages/donations.js';

function App() {
  

  return (
    <div className="App">
      <Navbar />
      <Homepage />
      <AboutUs/>
      <Donations/>
    </div>
  );
}

export default App;
